  return (
    <div style={{ textAlign: "center", marginTop: "50px" }}>
      <h1>Welcome to the Boxing Match Finder</h1>
      <p>対戦相手を見つけるには、Googleでサインインしてください。</p>
      <Auth />  {/* Google認証ボタンを配置 */}
    </div>
  );
};

export default Welcome;
